import groovy.json.JsonOutput
import groovy.json.JsonSlurper
import org.apache.nifi.processor.io.StreamCallback
import java.nio.charset.StandardCharsets
import java.time.Instant

flowFile = session.get()
if (!flowFile) return

flowFile = session.write(flowFile, { inputStream, outputStream ->
    def inputText = inputStream.getText(StandardCharsets.UTF_8.name())
    def parsed = new JsonSlurper().parseText(inputText)

    def pull_id = parsed.pull_id ?: null
    def streams = []

    // Safe parsing closures
    def parseLongSafe = { val ->
        try {
            return val?.isLong() ? val.toLong() : (val?.isNumber() ? val.toLong() : null)
        } catch (Exception e) {
            return null
        }
    }

    def parseIntSafe = { val ->
        try {
            return val?.isInteger() ? val.toInteger() : (val?.isNumber() ? val.toInteger() : 0)
        } catch (Exception e) {
            return 0
        }
    }

    parsed.data.each { item ->
        item = item.trim()
        if (item.startsWith("{") && item.endsWith("}")) {
            item = item.substring(1, item.length() - 1)
        }

        def map = [:]
        item.split(/, (?=\w+=)/).each { pair ->
            def (key, val) = pair.split("=", 2)
            map[key.trim()] = val?.trim()
        }

        def stream = [
            _id                : parseLongSafe(map['id']),
            game_id            : parseLongSafe(map['game_id']),
            game               : null,
            delay              : 0,
            channel            : [
                _id                       : parseLongSafe(map['user_id']),
                url                       : null,
                game                      : null,
                logo                      : null,
                name                      : null,
                views                     : null,
                mature                    : false,
                status                    : map['title'],
                partner                   : null,
                language                  : map['language'],
                followers                 : null,
                created_at                : Instant.now().toString(),
                updated_at                : Instant.now().toString(),
                description               : null,
                display_name              : null,
                video_banner              : null,
                profile_banner            : null,
                broadcaster_language      : map['language'],
                private_video             : false,
                broadcaster_type          : '',
                broadcaster_software      : '',
                privacy_options_enabled   : 'false'
            ],
            viewers            : parseIntSafe(map['viewer_count']),
            created_at         : map['started_at'],
            stream_type        : map['type'],
            broadcast_platform : map['type']
        ]

        streams << stream
    }

    def outputJson = JsonOutput.toJson([
        pull_id: pull_id,
        data: [
            _total : streams.size(),
            streams: streams
        ]
    ])

    outputStream.write(outputJson.getBytes(StandardCharsets.UTF_8))
} as StreamCallback)

session.transfer(flowFile, REL_SUCCESS)

import groovy.json.JsonSlurper
import groovy.json.JsonOutput

def flowFile = session.get()
if (!flowFile) return

flowFile = session.write(flowFile, { inputStream, outputStream ->
    def input = new JsonSlurper().parse(inputStream)
    def pull_id = input.pull_id
    def dataJson = JsonOutput.toJson(input.data)
    def escapedData = dataJson.replace("'", "''")  // Escape single quotes

    def sql = "INSERT INTO pull_data (pull_id, data) VALUES ('$pull_id', '$escapedData');"
    outputStream.write(sql.getBytes("UTF-8"))
} as StreamCallback)

session.transfer(flowFile, REL_SUCCESS)

